import { createSlice } from "@reduxjs/toolkit";

const ServicesSlice = createSlice({
    name:'services_slice',
    initialState:{},
    reducers:{
        Test:() => {
            console.log('from services slice');
        }
    }
});

export const {Test} = ServicesSlice.actions;
export default ServicesSlice.reducer;
